import react, {useState} from 'react';
const Deneme=()=> {
    const counter=useState(0);
    function fonk(params) {
        console.log(55)
    }
    
    return(
      <div>
         counter: {counter}
      </div>
    )
}

export default Deneme
export const nfonk= this.fonk;
